import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import axios from 'axios';
import '../assets/css/buscador.css'
import { Jumbotron } from 'react-bootstrap';



function Upload() {


  return (

    <Jumbotron className=" jum-style">
    <h1 className="texto-buscador">Subir Archivo</h1>
    <form onSubmit={this.obtenerDatos}>
        <div className="row" >
            <div className="form-group col-md-8">
                <input  ref={this.busquedaRef} type="text" className="form-control form-control-lg busqueda-place" placeholder="Buscar por numero de placa">
                </input>
            </div>
            <div className="form-group col-md-4">
                <input type="submit" className="btn btn-lg boton-pur btn-block" value="Buscar">
                </input>

            </div>
        </div>
    </form>
    

</Jumbotron>
    
  );
}


export default Upload;
